import React from "react";

import {  
    IonLabel, 
    IonButton, 
    IonGrid,
    IonRow, 
    IonCol, 
    IonList,
    IonItem,
    IonAvatar
  } from '@ionic/react';

import '../assets/css/Custom.css';
import '../assets/css/Responsive.css';

const ManageTenantGeneralTab: React.FC = () => {
    return (

        <div className="tab-content">
            <div className="requires-renewal-proposal-block">
                <h5>Requires Renewal Proposal (14)</h5>
                <IonGrid className="">
                    <IonRow className="">
                        <IonCol size="6" sizeMd="4" sizeLg="4" sizeXl="4" className="">
                            {/* <div className="apartment-info"> */}
                                <IonButton fill="clear">
                                    <div>
                                        <span>APt#</span>
                                        <h2>812</h2>
                                    </div>
                                </IonButton>
                            {/* </div> */}
                        </IonCol>
                    </IonRow>
                </IonGrid>
            </div>
        </div>
        
    );
};

export default ManageTenantGeneralTab;
